import React, {useState} from 'react';
import './App.css';



function App() {


  const [ab, setAb] = useState({name: 'nani'})

  const click = async() =>{
    const rew = await fetch('https://jsonplaceholder.typicode.com/users/1')
    const data = rew.json()

    setAb(data)
  }

  return (
    <div className="App">
      <h1>my name is {ab.name}</h1>
      <button onClick={click}>submit</button>
    </div>
  );
}

export default App;
